import './App.css';
import AppContent from './AppContent';
import LoginForm from './LoginForm';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<AppContent />} />  {/* Welcome Page */}
          <Route path="/admin-login" element={<LoginForm />} />  {/* Admin Login Page */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
